jQuery(document).ready(function(){jQuery("body").on("click",".reveal-address",function(){var s=jQuery(this).data("ip"),t=jQuery(this);jQuery.ajax({url:"http://ip-api.com/json/"+s,method:"GET",success:function(s){"fail"===s.status&&t.html("No Address"),"success"===s.status&&t.html(s.city+" "+s.region+" "+s.countryCode)}}),jQuery(this).css("color","black"),jQuery(this).css("text-decoration","none")})});